  - name: TEXT4000
    number: '4'
    value: This amendment is in response to correspondence dated 5/17/07 from the
      FEC regarding the Year End Report 11/28/06-12/31/06.  The original report filed
      on 1/27/07 listed an election cycle of 11/3/04-11/07/06.  The cycle date has
      been amended to 11/8/06-11/04-08 to properly reflect the period filed.  Changing
      the cycle date deleted the Post-Election Detailed Summary Page as requested
      by said correspondence from the FEC.  However
  - name: AMENDED CD
    number: '5'
    value: ' Column B is pulling cumulative totals on all dates from 11-8-07 forward
      regardless of where the receipts and expenses are being allocated within the
      electronic software (i.e.'
  - value: ' any item dated after 11/7/07 is being included by the software in Column
      B totals'
  - value: ' whether allocated to the general 2006 or primary 2008 cycle).  We are
      not sure why the FEC software is pulling these totals in Column B based upon
      date of entry and NOT upon election cycle.    This seems to be a software issue.  Please
      advise if you determine this change does not solve the issue or if any further
      changes are necessary.'
  expected_count: 5
  input: TEXT,F3A,,"This amendment is in response to correspondence dated 5/17/07
    from the FEC regarding the Year End Report 11/28/06-12/31/06.  The original report
    filed on 1/27/07 listed an election cycle of 11/3/04-11/07/06.  The cycle date
    has been amended to 11/8/06-11/04-08 to properly reflect the period filed.  Changing
    the cycle date deleted the Post-Election Detailed Summary Page as requested by
    said correspondence from the FEC.  However, Column B is pulling cumulative totals
    on all dates from 11-8-07 forward regardless of where the receipts and expenses
    are being allocated within the electronic software (i.e., any item dated after
    11/7/07 is being included by the software in Column B totals, whether allocated
    to the general 2006 or primary 2008 cycle).  We are not sure why the FEC software
    is pulling these totals in Column B based upon date of entry and NOT upon election
    cycle.    This seems to be a software issue.  Please advise if you determine this
    change does not solve the issue or if any further changes are necessary."
  input_count: 7
